import React, { useState } from 'react'
import { StyledHeader, StyledIcon } from './styles'
const Header = props => {
    return (
        <StyledHeader>
            <div className="header-icon-left">
               <StyledIcon src='assets/cuts/ic_webBack@2x.png' float='left'/>
            </div>
        </StyledHeader>
    )
}

export default  Header
